import { Button, DataTable } from 'carbon-components-react';

const { Table,TableRow, TableHead, TableContainer, TableHeader, TableBody, TableCell } = DataTable;
class HMCTable extends React.Component {
  render() {
  return (
    <DataTable
  filterRows={function noRefCheck(){}}
  headers={[
    {
      header: 'Name',
      key: 'name'
    },
    {
      header: 'Protocol',
      key: 'protocol'
    },
    {
      header: 'Port',
      key: 'port'
    },
    {
      header: 'Rule',
      key: 'rule'
    },
    {
      header: 'Attached Groups',
      key: 'attached_groups'
    },
    {
      header: 'Status',
      key: 'status'
    }
  ]}
  locale="en"
  overflowMenuOnHover
  render={function noRefCheck(){}}
  rows={[
    {
      attached_groups: 'Kevin’s VM Groups',
      id: 'a',
      name: 'Load Balancer 3',
      port: 3000,
      protocol: 'HTTP',
      rule: 'Round robin',
      status: 'Disabled'
    },
    {
      attached_groups: 'Maureen’s VM Groups',
      id: 'b',
      name: 'Load Balancer 1',
      port: 443,
      protocol: 'HTTP',
      rule: 'Round robin',
      status: 'Starting'
    },
    {
      attached_groups: 'Andrew’s VM Groups',
      id: 'c',
      name: 'Load Balancer 2',
      port: 80,
      protocol: 'HTTP',
      rule: 'DNS delegation',
      status: 'Active'
    },
    {
      attached_groups: 'Marc’s VM Groups',
      id: 'd',
      name: 'Load Balancer 6',
      port: 3000,
      protocol: 'HTTP',
      rule: 'Round robin',
      status: 'Disabled'
    },
    {
      attached_groups: 'Mel’s VM Groups',
      id: 'e',
      name: 'Load Balancer 4',
      port: 443,
      protocol: 'HTTP',
      rule: 'Round robin',
      status: 'Starting'
    },
    {
      attached_groups: 'Ronja’s VM Groups',
      id: 'f',
      name: 'Load Balancer 5',
      port: 80,
      protocol: 'HTTP',
      rule: 'DNS delegation',
      status: 'Active'
    }
  ]}
  size={null}
  sortRow={function noRefCheck(){}}
  translateWithId={function noRefCheck(){}}
/>
  );
}
}

export default HMCTable;
